import React from "react";

const ListGroup = () => {
  const { groups, currentGroup, onChangeGroup } = this.props;

  return (
    <ul className="list-group mb-4">
      <li className="list-group-item">All Generes</li>
      {groups.map((group) => (
        <li className="list-group-item">{group.name}</li>
      ))}
    </ul>
  );
};

export default ListGroup;
